function getContent(data) {
  return `
  <div class="infowindow">
    <div class="info-head">
        <h3 class="infowindow-title">${data.title}</h3>
        <div class="close" onclick="closeOverlay()" title="닫기"></div>'
    </div>
    <div class="info-left">
        <div class="info1">
          <h3>기본정보</h3>
          <p>학교급: ${data.category1}</p>
          <p>설립: ${data.category2}</p>
          <p>지역: ${data.category3}</p>
          <p>급지: ${data.category4}</p>
          <p>본교/분교/병설: ${data.category5}</p>
          <p>남여공학 여부: ${data.category6}</p>
        </div>
    </div>
    <div class="info-right">
        <div class="info2">
          <h3>추가정보</h3>
          <p>전체학급 수: ${data.category14}</p>
          <p>특수학급 수: ${data.category15}</p>
          <p>전체학생 수: ${data.category16}</p>
          <p>특수학생 수: ${data.category17}</p>
        </div>
    </div>  
    <div class="info-tail">
        <p></p>
    </div>  
</div>
  `;
}

async function setMap(dataSet) {
  markerArray = [];
  infowindowArray = [];

  for (var i = 0; i < dataSet.length; i ++) { 
    // 마커를 생성합니다
    if(dataSet[i].category1 === '유') {var imageSrc = "marker1.png"}
    if(dataSet[i].category1 === '초') {var imageSrc = "marker2.png"}
    if(dataSet[i].category1 === '중') {var imageSrc = "marker3.png"}
    if(dataSet[i].category1 === '고') {var imageSrc = "marker4.png"}
    if(dataSet[i].category1 === '특수') {var imageSrc = "marker5.png"}
    
    let coords = dataSet[i].latlng;
    var imageSize = new kakao.maps.Size(24, 35); 
    var markerImage = new kakao.maps.MarkerImage(imageSrc, imageSize); 
    var marker = new kakao.maps.Marker({
        map: map, // 마커를 표시할 지도
        position: coords, // 마커를 표시할 위치      
        title: dataSet[i].title,
        image: markerImage
    });

    markerArray.push(marker);


    // 마커에 표시할 인포윈도우를 생성합니다 
    var infowindow = new kakao.maps.InfoWindow({
      content: getContent(dataSet[i]) // 인포윈도우에 표시할 내용
    });


    // 마커에 mouseover 이벤트와 mouseout 이벤트를 등록합니다
    // 이벤트 리스너로는 클로저를 만들어 등록합니다 
    // for문에서 클로저를 만들어 주지 않으면 마지막 마커에만 이벤트가 등록됩니다
    kakao.maps.event.addListener(marker, 'click', makeOverListener(map, marker, infowindow));
    kakao.maps.event.addListener(map, 'click', makeOutListener(infowindow));
  }
}



// 인포윈도우를 표시하는 클로저를 만드는 함수입니다 
function makeOverListener(map, marker, infowindow) {
  return function() {
    infowindow.open(map, marker);
  };
}


// 인포윈도우를 닫는 클로저를 만드는 함수입니다 
function makeOutListener(infowindow) {
  return function() {
      infowindow.close();
  };
}





